const Contact = () => {
    return (  
        <div className="contact">
            <div className="form">
                <input type="text" placeholder="Enter Your Username" required></input>
                <input type="password" placeholder="Enter Your Password" required></input>
                <textarea placeholder="Enter Your Queries" name="review" id="review" rpws="4"></textarea> 
                <p>Select Your Gender</p>
                <label for="gender">
                    <input type="radio" value="Male" name="gender" id="gender"></input>
                </label>
                <label for="gender">
                    <input type="radio" value="Female" name="gender" value="gender"></input>
                </label>
            </div>
        </div>
    );
}

export default Contact;
